import styled, { keyframes } from 'styled-components'

export const keyFrameExampleOne  = keyframes `dd
  0% { opacity: 1.0; }
  70% { opacity: 1.0; }
  80% { opacity: 0.3; }
  90% { opacity: 1.0; }
  `;
